import React, { Component } from "react";
import axios from "axios";
import "./App.css";

class App extends Component {
  state = {
    songs: []
  };

  componentWillMount() {
    axios
      .get(
        "http://ws.audioscrobbler.com/2.0/?method=geo.gettoptracks&country=india&api_key=e125487ee7c050f4e926331f871841ee&format=json"
      )
      .then(response => {
        console.log(response.data);
        this.setState({
          songs: response.data.tracks.track
        });
      });
  }
  render() {
    let songs = this.state.songs.map(song => {
      return (
        <tr>
          <td>{song.name}</td>
          <td>{song.artist.name}</td>
          <td>{song.listeners}</td>
        </tr>
      );
    });

    return (
      <div className="App">
        <table>
          <tr>
            <th>Name</th>
            <th>Artist</th>
            <th>Album</th>
          </tr>

          {songs}
        </table>
      </div>
    );
  }
}

export default App;
